import video1 from '../Videos/video-1.mp4'
import { forwardRef, useImperativeHandle } from 'react'
function Video(props, ref){
    useImperativeHandle(ref)
    return (
        <video
        ref={ref}
        src={video1} 
        width={200}
        controls
        />
    )
}
export default forwardRef(Video)
